import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

export function Project1() {
  return (
    <Container>
        <Row>
            <Col xs={10} md={5}>
                <h5>Task Management</h5>
                <img src="" alt="img" />
            </Col>
            <Col xs={10} md={5}>
                <p>Description</p>
            </Col>
        </Row>
    </Container>
  )
}

export function Project2() {
    return (
      <div>project2aaaa</div>
    )
}
